<script type="text/javascript">
jQuery(function($){
	$('font').each(function(){
		var c = $( this ).css('color'),
		gray = Color( c ).filter('grayscale').red();
		gray = replace_gray( gray );
		$( this ).attr('color', Color([gray,gray,gray]).hex() )
	});
	function replace_gray ( v ){
		if ( v < 65 ) return 0; // black
		if ( v < 167 ) return 130; // drak gray
		if ( v < 219 ) return 204; // light gray
		return 234; // white
	}
});
</script>

